      }
      const key = String(name).toUpperCase();
      const result = BattleLogMessageType.#values[key];
      if (!result) {
        throw new Error(`Unknown BattleLogMessageType: ${name}`);
      }
      return result;
    }
  }

  export default BattleLogMessageType;
